import React from "react";
import { Handle } from "react-flow-renderer";

export default function CustomHandle(props) {
  return (
    <>
      {props.type === "source" ?
        <Handle
          type="source"
          id={props.id}
          style={{ ...props.style, width: "12px", height: "12px", marginRight: "-3px", background:"red", border: "1px solid #00ff00" }}
          position="right"
        />
        :
        <Handle
          type="target"
          id={props.id ? props.id : "0"}
          style={{ ...props.style, width: "12px", height: "12px", marginLeft: "-3px" }}
          position="left"
        />
      }
    </>
  );
}
